import React from 'react'
import axios from 'axios'

const airtableBase = process.env.REACT_AIRTABLE_BASE;
const airtableKey = process.env.REACT_AIRTABLE_KEY;
const URL = `https://api.airtable.com/v0/${airtableBase}/`;

const config = {
  headers: {
  authorization: `Bearers${airtableKey}`,
},
};
export default function Start() {
  axios.get(URL, config);
  return <div> start </div>


}
